import React from 'react';

import './App.css';

import { Header,Footer,Body,Left_sidebar,Right_sidebar } from './containers';



function App() {
  return (
    <div className="App">
      <Header></Header>
      <div className="body__container">
        <Left_sidebar></Left_sidebar> //eslint-disable-next-line
        <Body></Body>
        <Right_sidebar></Right_sidebar>
      </div>
      <Footer></Footer>
    </div>
  );
}

export default App;
